import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="row"> 
          <img src="https://github.com/kipply/engcalc/blob/master/web/src/images/images/1title.gif?raw=true"/>
          <img src="https://github.com/kipply/engcalc/blob/master/web/src/images/images/2factorial.gif?raw=true"/>
          <img src="https://github.com/kipply/engcalc/blob/master/web/src/images/images/3openbracket.gif?raw=true"/>
          <img src="https://github.com/kipply/engcalc/blob/master/web/src/images/images/4closingbracket.gif?raw=true"/>
          <img src="https://github.com/kipply/engcalc/blob/master/web/src/images/images/5modulo.gif?raw=true"/>
        </div>
        <div className="row2">
          <img src="https://github.com/kipply/engcalc/blob/master/web/src/images/images/6AC.gif?raw=true"/>
        </div>
      </div>
    );
  }
}

export default App;
